import styled from "styled-components";

export const Container = styled.div`
  width: 100%;
  height: 100%;
  position: absolute;
  display: flex;
  background: #f0f8ff;

`;

export const CADASTRO_ALARME = styled.div`
  width: 50vw;
  height: 20vh;
  //border: 3px solid black;
  //background: #fff567;

  display: flex;

  align-items: center;
  justify-content: center;
  position: absolute;
  left: 39%;
  margin-top: 3%;

  h3 {
    font-family: "Roboto", sans-serif;
    font-size: 16px;
    color: #f8612d;
    align-items: center;
    justify-content: center;
    position: relative;
    margin-top: 0%;
    margin-left: 0%;
  }
`;
